import "./App.css";

function Hello(props) {
  console.log(props);
  return (
    <div>
      <p>
        Hello {props.name}, you are {props.age} years old
      </p>
    </div>
  );
}

function Footer(props) {
  return (
    <div>
      <p>Greeting app created by Aitorias</p>
    </div>
  );
}

function App() {
  const now = Date();
  const a = 10;
  const b = 20;

  const name = "Aitor";
  const age = 29;

  console.log(now, a + b);
  return (
    <div>
      <h1>Greetings!</h1>
      <Hello name={name} age={age} />
      <p>it is {now.toString()}</p>
      <p>
        {a} plus {b} is {a + b}
      </p>
      <Footer />
    </div>
  );
}

export default App;
